import React from "react";
import Navbar from "./components/Navbar/Navbar.js";
import GlobalStyle from "./GlobalStyles.js";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
function App() {
  return (
    <Router>
      <GlobalStyle />
      <Navbar />
    </Router>
  );
}

export default App;
